import Styles from './exclusao.module.css'

function Exclusão({excluir,idConta}){
    return(
        <div className={Styles.exclusao}>
            <h3>Tem certeza que desejar excluir essa conta</h3>
            <div>
                <button>Sim</button>
                <button>Não</button>
            </div>
            
        </div>
    )
} 

export default Exclusão
